import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import Card from '../../components/Card';
import Button from '../../components/Button';

interface FundRequest {
  _id: string;
  hospitalName: string;
  amount: number;
  reason: string;
  urgency: string;
  requestDate: string;
  hospitalId: string;
  status: string;
}

const FundManagerDashboardPage: React.FC = () => {
  const [pendingRequests, setPendingRequests] = useState<FundRequest[]>([]);
  const [loading, setLoading] = useState(false);

  const fundManagerInfo = {
    name: 'Sarah Johnson',
    role: 'Senior Fund Manager'
  };

  // Fetch fund requests on mount
  useEffect(() => {
    const fetchRequests = async () => {
      setLoading(true);
      try {
        const token = localStorage.getItem('fundManagerToken');
        if (!token) {
          setPendingRequests([]);
          setLoading(false);
          return;
        }

        const res = await fetch('http://localhost:5000/api/fund-manager/fund-requests?status=pending', {
          headers: { Authorization: `Bearer ${token}` }
        });

        if (!res.ok) throw new Error('Failed to load requests');
        const data: FundRequest[] = await res.json();
        setPendingRequests(data);
      } catch (err) {
        console.error(err);
        setPendingRequests([]);
      }
      setLoading(false);
    };
    fetchRequests();
  }, []);

  const getUrgencyColor = (urgency: string) => {
    switch (urgency.toLowerCase()) {
      case 'high':
        return 'bg-red-100 text-red-800';
      case 'medium':
        return 'bg-yellow-100 text-yellow-800';
      case 'low':
        return 'bg-green-100 text-green-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div initial={{ opacity: 0, y: 20 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 0.5 }} className="mb-8">
          <h1 className="text-3xl font-bold text-gray-900">Welcome back, {fundManagerInfo.name}!</h1>
          <p className="text-gray-600 mt-2">Role: {fundManagerInfo.role}</p>
        </motion.div>

        <motion.div initial={{ opacity: 0, y: 20 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 0.5, delay: 0.1 }} className="mb-8">
          <Card>
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Pending Fund Requests</h2>
            {loading ? (
              <p>Loading...</p>
            ) : pendingRequests.length === 0 ? (
              <p>No pending fund requests.</p>
            ) : (
              pendingRequests.map((request) => (
                <div key={request._id} className="flex items-center justify-between py-4 border-b border-gray-100 last:border-b-0">
                  <div className="flex-1">
                    <div className="flex items-center space-x-3 mb-2">
                      <h3 className="font-medium text-gray-900">{request.hospitalName}</h3>
                      <span className={`inline-flex items-center px-2 py-1 rounded-full text-xs font-medium ${getUrgencyColor(request.urgency)}`}>
                        {request.urgency}
                      </span>
                    </div>
                    <div className="flex space-x-4 text-sm text-gray-500">
                      <span>Amount: ${request.amount.toLocaleString()}</span>
                      <span>Date: {new Date(request.requestDate).toLocaleDateString()}</span>
                      <span>ID: {request.hospitalId}</span>
                      <span>Status: {request.status}</span>
                    </div>
                    <p className="text-sm text-gray-600 mt-1">{request.reason}</p>
                  </div>
                  <div className="space-x-2 text-right">
                    <Link to={`/fund-manager/approve-reject/${request._id}`}>
                      <Button size="sm">Review</Button>
                    </Link>
                  </div>
                </div>
              ))
            )}
          </Card>
        </motion.div>
      </div>
    </div>
  );
};

export default FundManagerDashboardPage;
